import React from 'react'
import "./style.css"
import { useNavigate } from "react-router-dom";
const navigate = useNavigate();
export default function Card(props) {
  const {companyName}=props
    return (
      <div className='Card-name' onClick={() => navigate("/")}>
        {companyName}
      </div>  
    );
}
